import React from 'react';

function MyPokemons(){
    var myPokemons = JSON.parse(window.localStorage.getItem("myPokemons"));

    if (myPokemons!=null){
        return(
            myPokemons.map(mp => (
                <div key={mp.nickname}>
                    <h1>{mp.name}</h1>
                    <img src={mp.image} alt={mp.name}/>
                    <p>Nickname: {mp.nickname}</p>
                    <button>Release Pokemon</button>
                </div>
            ))
        );
    }else{
        return (
            <p>No Pokemons caught yet:(</p>
        );
    }
}

export default MyPokemons;
